import React from 'react';

let minutesArr = [];
for(let i=0; i<60; i++){
    minutesArr[i] = i + 1;
}

class PracticeScript extends React.Component {

    render() {
        return(
            <p>{this.props.script}</p>
        );
    }
}

export default PracticeScript;
